INSERT INTO `courses` VALUES (1,'Club Jarama RACE','Ctra Burgos km 28',72,6497,NULL,6070,5109,1,'2009-11-29 18:01:22','2010-08-04 18:04:14',18,'Sobre la Sierra de Madrid se localiza este campo de golf con excelentes vistas sobre la capital. Sus anchas calles están bien protegidas por árboles y van venciendo los diferentes desniveles que tiene el terreno. La mayor dificultad se encuentra en l','Sobre la Sierra de Madrid se localiza este campo de golf con excelentes vistas sobre la capital. Sus anchas calles están bien protegidas por árboles y van venciendo los diferentes desniveles que tiene el terreno. La mayor dificultad se encuentra en los greenes, muy protegidos y con gran número de búnkers.','1967','Javier Arana',5,8,5,6,7,3,7,'40.622422','-3.597293',1),(2,'La Duquesa','Sabinillas',72,6062,5204,5577,4885,1,'2009-11-29 18:01:44','2010-08-04 17:58:39',18,'Un recorrido agradable para todo tipo de estilos bien diferenciados.','Un recorrido agradable para todo tipo de estilos bien diferenciados. La primera parte cuenta con calles estrechas y greenes exigentes, mientras que en la segunda las calles son más anchas y los hoyos más fáciles de afrontar. Buen emplazamiento de los bunkers.','1983','Robert Trend Jones',1,8,8,6,4,6,6,'36.352601','-5.234621',1),(5,'Club de Golf Oliva Nova','Urbanización Oliva Nova Golf 46780 Oliva (Valencia)',72,6270,NULL,6037,5157,1,'2010-06-08 12:33:22','2010-06-08 12:33:22',18,'Campo diseñado por Severiano Ballesteros, ofrece un recorrido muy completo.','Campo diseñado por el campeón español Severiano Ballesteros. Ofrece un recorrido muy completo, con todas las ventajas para convertirse en un lugar de referencia en elmundo del golf.','1995','Severiano Ballesteros',3,7,8,5,7,7,7,NULL,NULL,1),(6,'Club de Campo Villa de Madrid','Ctra. Castilla km 2; 28040 Madrid',71,6374,NULL,6045,5111,1,'2010-06-14 10:18:53','2010-06-14 10:18:53',18,'Un complejo de grandes dimensiones al pie de Madrid. Presenta numerosos obstáculos, principalmente árboles y búnkers, que exigen una buena técnica y un juego preciso.','Un complejo de grandes dimensiones al pie de Madrid. Presenta numerosos obstáculos, principalmente árboles y búnkers, que exigen una buena técnica y un juego preciso.','1932','Javier Arana',6,8,8,6,7,3,8,NULL,NULL,1),(7,'Club de Golf Somosaguas','Avda de la Cabaña s/n; 28223 Pozuelo de Alarcón',70,6054,NULL,5683,4982,1,'2010-06-14 10:28:09','2010-06-14 10:28:09',18,'Este campo de 9 hoyos que se juegan dos veces se está trasnformando radicalmente.Entre los diferentes obstáculos que presenta destacan el lago del hoyo 4, el único existente durante el recorrido, y la compleja situación de los búnkers. Pueden disfrut','Este campo de 9 hoyos que se juegan dos veces se está trasnformando radicalmente.Entre los diferentes obstáculos que presenta destacan el lago del hoyo 4, el único existente durante el recorrido, y la compleja situación de los búnkers. Pueden disfrutar en e? todo tipo de jugadores, pues se trata de un campo de nivel asequible.','1995','Mackenzie Ross',1,8,7,6,6,4,6,NULL,NULL,1),(8,'Club de Golf Lomas - Bosque','Guadiana 102 Urbanización El Bosque; 28670 Villaviciosa de Odón',72,6148,NULL,5869,5024,1,'2010-06-14 10:31:17','2010-06-14 10:31:17',18,'Este campo está asentado sobre un terreno bastante irregular,lo que dificulta en ocasiones el juego. La mayoría de las calles de la primera parte están flanqueadas por árboles, mientras que las dela segunda cuentan con un lago de grandes dimensiones ','Este campo está asentado sobre un terreno bastante irregular,lo que dificulta en ocasiones el juego. La mayoría de las calles de la primera parte están flanqueadas por árboles, mientras que las dela segunda cuentan con un lago de grandes dimensiones como obstáculo principal. Para todo tipo de jugadores.','1973','Robert D. Putman',0,7,8,5,7,7,6,NULL,NULL,1),(9,'Casino Club de Golf Los Retamares','Ctra de Algete a Alapardo km 2,300 - 28310 Alapardo-Valdeolmos',72,6238,NULL,6038,5114,1,'2010-06-17 15:15:40','2010-06-17 15:15:40',18,NULL,'Un campo ideado para todo tipo de jugadores. El recorrido es muy asequible y permite la utilización de todos los palos. Son de destacar los greenes rápidos y la estratégica ubicación de los búnkers.','1991','IGD',4,7,7,6,6,6,6,NULL,NULL,1);
